import * as React from 'react';
import AccordionItem from "../../components/Accordion/AccordionItem/AccordionItem";
import Accordion from "../../components/Accordion/Accordion";


const Home: React.FC = () => {

  return (
      <div>
        <Accordion id={'blubb'} name={'Accordion'}>
          <AccordionItem
              name={'öffne mich'}
              titleDescription={'Do., 5. Oktober 2019'}
              title={'13.00–20.00 • Lorenz-Mandl-Gasse 51/1 • Waschkabine XXI'}
              errorMessage={{
                title: 'Waschgeräte defekt',
                description: `In der Waschkabine XXI Lorenz-Mandl-Gasse 51/1 wurden Waschmaschine und Trockner als defekt gemeldet. Die Wartungsfirma ist bereits informiert.`,
              }}
          >
            <p>Hello Accordion Item 1</p>
          </AccordionItem>
          <AccordionItem name={'öffne mich'} title="Center">
            <p>Hello Accordion Item 2</p>
          </AccordionItem>
          <AccordionItem name={'öffne mich'} title="End">
            <p>Hello Accordion Item 2</p>
          </AccordionItem>
        </Accordion>
      </div>
  );
};

export default Home;
